   fMin_1[2][3] = 0.139969557524;
   fMax_1[2][3] = 6453.60449219;
   fMin_1[0][4] = 2.394541502;
   fMax_1[0][4] = 1570.30053711;
   fMin_1[1][4] = 1.42221820354;
   fMax_1[1][4] = 2166.71142578;
   fMin_1[2][4] = 1.42221820354;
